What mongo query can i use to get distinct value counts of a specific field for a date range?<p>Let's say i have a fruit field. I do a date range query from 3/19 to 3/21 but want to get a count for each day of what different types of fruit people ate, and how many times did they eat it for each day.</p>

<p>Here's what I have so far. </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>db.getCollection('fruits').aggregate([
  {
    "$match": {
      "dates": {
        "$gte": new Date(2018, 02, 19, 00, 00, 00),
        "$lt": new Date(2018, 02, 21, 00, 00, 00)
      }
    }
  },
  {
    "$group": {
      "_id": {
        year: {
          $year: "dates"
        },
        month: {
          $month: "dates"
        },
        day: {
          $dayOfMonth: "dates"
        },
        "fruitField": "$fruits"
      },
      "count": { "$sum": 1 }
    }
  }
]</code></pre>
</div>
</div>
</p>

<p>Edit:</p>

<p>An expected output would be something like:
19th:
Oranges: 17
Apples: 19
Pears: 8</p>

<p>20th: 
Oranges: 6
Pears: 4</p>

<p>21st:
Oranges:3
Apples: 10
Pears: 4</p>

