Fetching json from Mongo with Meteor<p>I am trying to fetch a json object from the mongodb using meteor, but I have no clue why Im unable to do so.</p>

<p><strong>I need it to be a JSON object only.</strong></p>

<p>One of the entries of the collection looks like this:</p>

