<p>Im trying to fetch the <strong>value</strong> part by passing the <strong>name</strong>.</p>

<p><strong>Code on front end:</strong></p>

<pre><code>export default withTracker(() =&gt; {
  let aSub = Meteor.subscribe(allEntries);
  return {
    aBoundaries: DataCollection.find({}).fetch()    
   }
})(Component Name);
</code></pre>

