dataFromDb = Meteor.call(functionToBeCalled, Sydney);</p>

<p><strong>Server-side Code:</strong></p>

<pre><code>Meteor.publish(allEntries, function(){
    return DataCollection.find();
});

Meteor.methods({
   functionToBeCalled(aName){
      return DataCollection.find({name: aName});
   }
});
</code></pre>

<p><strong>Another of my questions is:</strong>
Is there any way that we publish only all the names in the beginning and then publish the values on demand?</p>

<p>Thanks for your help in advance!</p>

<p>I have tried this as well, but it did not work:</p>

<pre><code>functionToBeCalled(aName){
        var query = {};    
        query['name'] = aName;
        return DataCollection.find(query).fetch();
}
</code></pre>

