Mongoose: schema methods that reference other schema methods?<p>I am trying to work on a schema method that references the schema method for a different model. For example:</p>

<p>Model 1:</p>

<pre><code>const DomainSchema = new mongoose.Schema({
  thing: { type: string, required: true },
  subthings: [
    { type: mongoose.Schema.Types.ObjectId, ref: 'Subdomain' }
  ]
})

DomainSchema.methods.toJSONFor = function() {
  return {
    _id: this._id,
    thing: this.thing,
    subthings: this.subthings.map(subthing =&gt; subthing.mymethod())
  }
}
</code></pre>

<p>Model 2:</p>

<pre><code>const SubdomainSchema = new mongoose.Schema({ /* doesnt matter whats in here */ })

SubdomainSchema.methods.mymethod = function() {
  return {
    _id: this.id,
    type: this.type,
    name: this.name
  }
}
</code></pre>

<p>Erroring to say: <code>"subthing.myMethod is not a function"</code></p>

<p>My question is, should mongoose be able to grab these subthings and cast them automatically to their db objects when I call the method in <code>DomainSchema.toJSONFor()</code>? Or in <code>toJSONFor</code> should I be doing something like: </p>

<pre><code>subthings: await Promise.all(this.subthings.map(subthing =&gt; 
      Subdomain.findById(subthing).then(foundThing =&gt; foundThing.myMethod())
    ))
</code></pre>

<p>And is that bad? It seems <em>really weird</em> to reference a model within another model.</p>

